import Card from "./Card";
import axios from "axios";

const Home = () => {
    useEffect(() => {
        async function getData() {
            const response = await axios.get(
                "https://api.themoviedb.org/3/movie/popular/?api_key=692ad17fefe3f279a5bc0dfa87752845"
            );
            console.log(response.results[0].poster_path);
        }
        getData();
    }, []);

    return (
        <div className="container mt-5">
            <div className="row">
                <Card img="https://m.media-amazon.com/images/M/MV5BNWM0ZGJlMzMtZmYwMi00NzI3LTgzMzMtNjMzNjliNDRmZmFlXkEyXkFqcGdeQXVyMTM1MTE1NDMx._V1_.jpg"></Card>
